import React from 'react';
import { createRoot } from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import { AuthProvider } from './auth/AuthProvider';

const container = document.getElementById('root');
const root = createRoot(container);

// Alias destroy for any stray calls (React-Refresh safety-net)
root.destroy = root.unmount;

// Render your app
root.render(
  <React.StrictMode>
    <AuthProvider>
      <App />
    </AuthProvider>
  </React.StrictMode>
);

// If HMR is active, dispose by unmounting cleanly
if (module.hot) {
  module.hot.accept();
  module.hot.dispose(() => {
    root.unmount();
  });
}

reportWebVitals();
